INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1109501040, /*drama_id*/1109501, /*command_type*/11, /*param_01*/110911, /*param_02*/"ちぇる～ん☆　わあ素敵なケーキ！\n先輩の手作りですよね、何ですこれ？\nえっ、お誕生日のお祝いって誰の……\n私の？　やん、うっかり忘却の彼方！", /*param_03*/5, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1109501041, /*drama_id*/1109501, /*command_type*/91, /*param_01*/0, /*param_02*/"", /*param_03*/"", /*param_04*/"", /*param_05*/"", /*param_06*/"", /*param_07*/"", /*param_08*/"");
INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1109501042, /*drama_id*/1109501, /*command_type*/21, /*param_01*/"vo_adv_1109501", /*param_02*/"vo_adv_1109501_001", /*param_03*/0, /*param_04*/0, /*param_05*/"", /*param_06*/"", /*param_07*/"", /*param_08*/"");
INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1109501043, /*drama_id*/1109501, /*command_type*/11, /*param_01*/110911, /*param_02*/"──ま、嘘ですけどね。自分の誕生日\n忘れるとか、あるわけないですから。\nこういう反応する子は皆やってますよ。\n髪の毛ピンクの子は大体やるんです。", /*param_03*/6, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1109501044, /*drama_id*/1109501, /*command_type*/91, /*param_01*/0, /*param_02*/"", /*param_03*/"", /*param_04*/"", /*param_05*/"", /*param_06*/"", /*param_07*/"", /*param_08*/"");
INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1109501045, /*drama_id*/1109501, /*command_type*/21, /*param_01*/"vo_adv_1109501", /*param_02*/"vo_adv_1109501_002", /*param_03*/0, /*param_04*/0, /*param_05*/"", /*param_06*/"", /*param_07*/"", /*param_08*/"");
INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1109501046, /*drama_id*/1109501, /*command_type*/11, /*param_01*/110911, /*param_02*/"ハ？　なに言ってるんですか先輩。\nいや嬉しいですよ、全然嬉しいですよ！\nそうじゃなくて単なるお約束っていうか\n……まあ照れ隠しみたいなもんです。", /*param_03*/5, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1109501047, /*drama_id*/1109501, /*command_type*/91, /*param_01*/0, /*param_02*/"", /*param_03*/"", /*param_04*/"", /*param_05*/"", /*param_06*/"", /*param_07*/"", /*param_08*/"");
