INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1109501049, /*drama_id*/1109501, /*command_type*/11, /*param_01*/110911, /*param_02*/"そんなことよりどーすんですか先輩、\nこんな大っきいケーキ……チエルの為に\nどんだけ張り切っちゃったんですか。\nああもう、一緒に食べてくださいね！", /*param_03*/6, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
